import React from 'react';
import './Menu.scss';



export const Menu = () => {

        return (
            <div id="menu">
                <nav>
                    <a>Strona główna</a>
                    <span className="big-dot">.</span>
                    <a>O stajni</a>
                    <a>Wydarzenia</a>
                    <a>Nasze konie</a>
                    <a>Oferta</a>
                    <a>Cennik</a>
                    <a>E-rezerwacje</a>
                    <a>Kontakt</a>
                </nav>
            </div>

        );
      }
